    );
  function spinGoldenWheel() external;
  function spinSilverWheel() external;
}","keccak256":"0x865296fa4de84230396ab36564f6cf2957fb0c0b2cc44d69673516e327726497","license":"MIT"},"contracts/IPRNG.sol":{"content":"// SPDX-License-Identifier: MIT

